import React from 'react'
import detail from '../data/productDetail'

import {
    ProductName,
} from "../styled"

const ProductDetail = () => {
    return <>{detail.detailProd.map((product)=>(
        <div>
            <ProductName> {product.title}</ProductName>

        </div>
    ))}
    </>
}

export default ProductDetail;
